(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d21a7e3"],{bc6b:function(t){t.exports=JSON.parse('{"name":"Strings","description":"","items":[{"tags":[{"name":"strings","url":"/tags/strings"}],"title":"CF-1200E Compress Words","excerpt":"Amugae has a sentence consisting of $n$ words. He want to compress this sentence into one word. Amugae doesn\'t like repetitions, so when he merges two words into one word, he removes the longest prefix of the second word that coincides with a suffix of the first word. For example, he merges \\"sample\\" and \\"please\\" into \\"samplease\\".","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/kmp/cf-1200e"},{"tags":[{"name":"strings","url":"/tags/strings"}],"title":"TJOI-2017 DNA","excerpt":"加里敦大学的生物研究所，发现了决定人喜不喜欢吃藕的基因序列 $S$,有这个序列的碱基序列就会表现出喜欢吃藕的性状，但是研究人员发现对碱基序列 $S$，任意修改其中不超过 $3$ 个碱基，依然能够表现出吃藕的性状。现在研究人员想知道这个基因在 DNA 链 $S_0$ 上的位置。所以你需要统计在一个表现出吃藕性状的人的 DNA 序列 $S_0$ 上，有多少个连续子串可能是该基因，即有多少个 $S_0$ 的连续子串修改小于等于三个字母能够变成 $S$。","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/luogu-3763"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"data structures","url":"/tags/data-structures"}],"title":"UVA-11475 Extend to Palindrome","excerpt":"Your task is, given an integer $N$, to make a palidrome (word that reads the same when you reverse it) of length at least $N$.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/uva-11475"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"data structures","url":"/tags/data-structures"}],"title":"SPOJ-687 REPEATS - Repeats","excerpt":"A string s is called an (k,l)-repeat if s is obtained by concatenating k>=1 times some seed string t with length l>=1. For example, the string","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/spoj-687"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"data structures","url":"/tags/data-structures"}],"title":"POJ-3693 Maximum repetition substring","excerpt":"The repetition number of a string is defined as the maximum number R such that the string can be partitioned into R same consecutive substrings. For example, the repetition number of \\"ababab\\" is 3 and \\"ababa\\" is 1.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/poj-3693"},{"tags":[{"name":"strings","url":"/tags/strings"}],"title":"POJ-3581 Sequence","excerpt":"Given a sequence, $\\\\{A_1, A_2, ..., A_n\\\\}$ which is guaranteed $A_1 > A_i, \\\\forall i > 1$ and $-2^31 < A_i < 2^31$, you are to cut it into three non-empty sub-sequences and reverse them separately to form a new one which is the smallest possible sequence in alphabet order.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/poj-3581"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"data structures","url":"/tags/data-structures"}],"title":"POJ-3415 Common Substrings","excerpt":"A substring of a string $T$ is defined as:","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/poj-3415"},{"tags":[{"name":"strings","url":"/tags/strings"}],"title":"POJ-2774 Long Long Message","excerpt":"The little cat is majoring in physics in the capital of Byterland. A piece of sad news comes to him these days: his mother is getting ill. Being worried about spending so much on railway tickets (Byterland is such a big country, and he has to spend 16 shours on train to his hometown), he decided only to send SMS with his mother.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/poj-2774"},{"tags":[{"name":"strings","url":"/tags/strings"}],"title":"POJ-1226 Substrings","excerpt":"You are given a number of case-sensitive strings of alphabetic characters, find the largest string X, such that either X, or its inverse can be found as a substring of any of the given strings.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/poj-1226"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"data structures","url":"/tags/data-structures"}],"title":"POJ-3294 Life Forms","excerpt":"Given the DNA sequences of several life forms represented as strings of letters, you are to find the longest substring that is shared by **more than** half of them.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/poj-3294"},{"tags":[{"name":"strings","url":"/tags/strings"}],"title":"SPOJ-705 SUBST1 - New Distinct Substrings","excerpt":"Given a string, we need to find the total number of its distinct substrings.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/spoj-705"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"divide-and-conquer","url":"/tags/divide-and-conquer"}],"title":"POJ-1743 Musical Theme","excerpt":"Many composers structure their music around a repeating \\"theme\\", which, being a subsequence of an entire melody, is a sequence of integers in our representation. A subsequence of a melody is a theme if it:","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/poj-1743"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"divide-and-conquer","url":"/tags/divide-and-conquer"}],"title":"POJ-3450 Corporate Identity","excerpt":"Take all existing trademarks and find the longest common sequence of letters that is contained in all of them.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/poj-3450"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"divide-and-conquer","url":"/tags/divide-and-conquer"}],"title":"USACO06-DEC Milk Patterns G","excerpt":"Farmer John has noticed that the quality of milk given by his cows varies from day to day. On further investigation, he discovered that although he can\'t predict the quality of milk from one day to the next, there are some regular patterns in the daily milk quality.","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/luogu-2852"},{"tags":[{"name":"strings","url":"/tags/strings"},{"name":"data structures","url":"/tags/data-structures"}],"title":"HAOI-2016 找相同字符","excerpt":"给定两个字符串，求出在两个字符串中各取出一个子串使得这两个子串相同的方案数。两个方案不同当且仅当这两个子串中有一个位置不同。","updated_at":"2020-10-17T10:05:41+08:00","created_at":"2020-10-17T10:05:41+08:00","url":"/docs/strings/suffix-array/luogu-3181"}],"url":"/tags/strings"}')}}]);
